import React, { Component } from 'react';
import { StyledUserSignup } from './styles';
import { CREATE_NOTE } from '../../query'
import { Mutation } from 'react-apollo'


class UserSignup extends Component {
    constructor(props) {
        super(props);
        this.state = { 
            name: '',
            email: '',
            age: '',
            password: '',
            confirmPswd: '',
        }
    }

    // static getDerivedStateFromProps(nextProps, prevState) {
    //     if (prevState.stateChange && nextProps.location.state.note !== prevState){
    //       return nextProps.location.state.note;
    //     }
    //     return null;
    // }

    displayAlert = (res) => {
        window.alert("Note Added Successfully", res);
    }

    handleSubmit = () => {
        this.setState(state => ({
            name: '',
            email: '',
            age: '',
            password: '',
            confirmPswd: ''
        }));
    }

    handleChange = (evt) => {
        this.setState({ [evt.target.name]: evt.target.value , stateChange:false});
        // this.setState({stateChange: false});
    }

    handleReset = () => {
        this.setState({
            name: '',
            email: '',
            age: '',
            password: '',
            confirmPswd: ''
        });
    }

    onKeyUp = (target, event) => {
        if (event.keyCode === 13) {
            switch (target) {
                case 'name': this.content.focus();
                break;
                case 'email': this.author.focus();
                break;
                case 'age': this.place.focus();
                break;
                case 'password': this.confirmPswd.focus();
                break;
                case 'conformPswd': this.submit.focus();
                break;
                default: return null;
            }
        }
    }

    render() {
        const state = this.props.location.state;
        const { name, age, email, password, confirmPswd } = this.state;
        const { isUpdate = false } = this.props.location.state || {};
        const submitButtonText = isUpdate ? "Update Note" : "Submit Note";
        return (
            <StyledUserSignup>
                <div className="note">
                    Name: <input
                        style={{ marginLeft: "55px" }}
                        placeholder="Enter User Name"
                        type="text"
                        name="name"
                        onChange={this.handleChange}
                        value={this.state.name}
                        ref={(input) => { this.name = input }}
                        onKeyUp={this.onKeyUp.bind(this, 'name')}
                    /><br />
                    Age: <input
                        placeholder="Enter note content"
                        type="text"
                        name="content"
                        onChange={this.handleChange}
                        value={this.state.content}
                        ref={(input) => { this.content = input }}
                        onKeyUp={this.onKeyUp.bind(this, 'content')}
                    /><br />
                    Email: <input
                        style={{ marginLeft: "40px" }}
                        placeholder="Enter note author"
                        type="text"
                        name="author"
                        onChange={this.handleChange}
                        value={this.state.author}
                        ref={(input) => { this.author = input }}
                        onKeyUp={this.onKeyUp.bind(this, 'author')}
                    /><br />
                    Password: <input
                        style={{ marginLeft: "50px" }}
                        placeholder="Enter note place"
                        type="text"
                        name="place"
                        onChange={this.handleChange}
                        value={this.state.place}
                        ref={(input) => { this.place = input }}
                        onKeyUp={this.onKeyUp.bind(this, 'place')}
                    /><br />
                    Confirm Pswd: <input
                        style={{ marginLeft: "50px" }}
                        placeholder="Enter note place"
                        type="text"
                        name="place"
                        onChange={this.handleChange}
                        value={this.state.place}
                        ref={(input) => { this.place = input }}
                        onKeyUp={this.onKeyUp.bind(this, 'place')}
                    /><br />
                    <Mutation mutation={CREATE_NOTE}>{
                        createNote => (
                            <button type="button"
                                className="submit-btn"
                                ref={(input) => { this.submit = input }}
                                onKeyUp={this.onKeyUp.bind(this, 'submit')}
                                disabled={!(title && content && author && place)}
                                onClick={() => {
                                    this.handleSubmit();
                                    createNote({ variables: { title, content, author, place } })
                                        .then(res => this.displayAlert(res))
                                        .catch(err => console.log("Error", err))
                                }}>{submitButtonText}</button>
                        )
                    }
                    </Mutation>
                    <button
                        className="reset-btn"
                        type="button"
                        onClick={this.handleReset}
                        disabled={!(title || content || author || place)}
                    >Reset</button>
                </div>
            </StyledUserSignup>
        );
    }
}

export default UserSignup;
